INSERT INTO `glpi_knowbaseitems` VALUES (26,0,1,22,'DocumentaÃ§Ã£o Oficial Microsoft - ConfiguraÃ§Ã£o ServiÃ§o Wireless','&lt;p&gt;Links para os respectivos Sistemas Operacionais:&lt;/p&gt;\n&lt;p&gt;&lt;a href=\"http://translate.google.com.br/translate?hl=pt-BR&amp;langpair=en%7Cpt&amp;u=http://support.microsoft.com/kb/870702\"&gt;Windows XP&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;&lt;a href=\"http://windows.microsoft.com/pt-BR/windows7/View-and-connect-to-available-wireless-networks\"&gt;Windows Seven&lt;/a&gt;&lt;/p&gt;',0,16,7,'2010-08-03 15:02:41','2010-08-12 17:07:15'),(27,0,1,24,'LigaÃ§Ãµes Externas','&lt;p&gt;Segue associado a esse item um tutorial para o cadastramento de senha no Call Manager, para que os usu&#225;rios fa&#231;am liga&#231;&#245;es externas.&lt;/p&gt;\n&lt;p&gt;&#160;&lt;/p&gt;',0,16,15,'2010-08-03 15:46:18','2010-08-12 17:06:44'),(25,0,1,22,'VertoNOC','&lt;div id=\"kbanswer\"&gt;\n&lt;p&gt;Caso o usu&#225;rio tenha qualquer dificuldade em acessar a conex&#227;o Wireless da Verto (VertoUser), entre em contato com o Suporte Verto atrav&#233;s do e-mail:&lt;/p&gt;\n&lt;p style=\"text-align: center;\"&gt;&#160;&lt;a href=\"mailto:infra@verto.com.br\"&gt;&lt;strong&gt;&lt;span style=\"color: #659900;\"&gt;infra@verto.com.br&lt;/span&gt;&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;O Analista respons&#225;vel dever&#225; seguir os procedimentos descritos no documento anexado a este item;&lt;/p&gt;\n&lt;/div&gt;',0,16,9,'2010-08-03 15:00:23','2010-08-12 17:07:49'),(23,0,0,20,'AlteraÃ§Ã£o de senha','&lt;p&gt;Para alterar a senha do Webmail Verto, o usu&#225;rio dever&#225; consultar os arquivos citados abaixo,&#160;nesse item.&lt;/p&gt;',0,16,7,'2010-08-03 13:11:25','2010-08-03 13:11:25'),(24,0,1,21,'Problemas com senha','&lt;p&gt;Caso o usu&#225;rio, esque&#231;a ou n&#227;o saiba sua senha do Webmail da Verto, entre em contato com o Suporte Verto, atr&#225;ves do E-mail: &lt;a href=\"mailto:infra@verto.com.br\"&gt;&lt;strong&gt;&lt;span style=\"color: #65