r o Suporte de sua respectiva Institui&#231;&#227;o;&lt;/li&gt;\n&lt;/ul&gt;',0,16,4,'2010-08-03 13:01:19','2010-08-06 15:03:37'),(21,0,0,15,'Adicionar Assinatura de e-mail (MAC)','&lt;p&gt;Segue associado neste item um tutorial descrevendo como adicionar uma Assinatura de e-mail para os usu&#225;rios MAC.&lt;/p&gt;',0,16,15,'2010-08-03 12:41:26','2010-08-03 12:41:26'),(20,0,0,15,'DocumentaÃ§Ã£o Oficial Apple','&lt;p&gt;&lt;a href=\"http://docs.info.apple.com/article.html?path=Mail/2.0/pt/ml454.html\"&gt;Site oficial Apple&lt;/a&gt;&lt;/p&gt;',0,16,1,'2010-08-03 12:39:06','2010-08-03 12:39:06'),(35,0,1,36,'ValidaÃ§Ã£o do Windows 7 - Material Oficial Microsoft','&lt;p&gt;&lt;a href=\"http://www.microsoft.com/genuine/products/Windows7.aspx?displaylang=pt-br\"&gt;Material Oficial Microsoft&lt;/a&gt;&lt;/p&gt;',0,16,5,'2010-08-09 13:14:37','2010-08-12 17:04:51'),(38,0,1,36,'InstalaÃ§Ã£o Windows 7','&lt;p&gt;&lt;a href=\"http://www.guiadowindows.net/como-instalar-o-windows-7/\"&gt;Material de Instala&#231;&#227;o do Windows 7&lt;/a&gt;&lt;/p&gt;',0,16,3,'2010-08-09 13:22:10','2010-08-12 17:04:01'),(32,0,1,17,'DesabilitaÃ§Ã£o de conta','&lt;p&gt;Segue associado a este item, um tutorial para desabilitar contas de usu&#225;rios criados e em atividade.&lt;/p&gt;\n&lt;p&gt;Para a desabilita&#231;&#227;o de uma conta de usu&#225;rio &#233; necess&#225;rio entrar em contato com o servi&#231;o de HelpDesk atrav&#233;s do e-mail:&lt;/p&gt;\n&lt;p&gt;infra@verto.com.br&lt;/p&gt;',0,16,7,'2010-08-06 15:51:41','2010-08-12 17:05:56'),(33,0,1,33,'Embratel','&lt;p&gt;Em caso de interrup&#231;&#227;o dos servi&#231;os da Embratel, ligue para o telefone:&lt;/p&gt;\n&lt;p&gt;&#160;&lt;/p&gt;\n&lt;p&gt;&lt;!--  /* Font Definitions */  @font-face 	{font-family:Calibri; 	panose-1:2 15 5 2 2 2 4 3 2 4; 	mso-font-charset:0; 	mso-generic-font-family:swiss; 	mso-font-pitch:variable; 	mso-font-signature:-520092929 1073786111 9 0 415 0;}  /* Style Definitions */  p.MsoNormal, li.MsoNormal, div.MsoNormal 	{mso-style-unhide:no; 	mso-style-qformat:yes; 	mso-style-parent:\"\"; 	margin:0cm; 	margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:12.0pt; 	font-family:\"Times New Roman\",\"serif\"; 	mso-fareast-font-family:Calibri; 	mso-fareast-theme-font:minor-latin;} .MsoChpDefault 	{mso-style-type:export-only; 	mso-default-props:yes; 	font-size:10.0pt; 	mso-ansi-font-size:10.0pt; 	mso-bidi-font-size:10.0pt;} @page WordSection1 	{size:612.0pt 792.0pt; 	margin:70.85pt 3.0cm 70.85pt 3.0cm; 	mso-header-margin:36.0pt; 	mso-footer-margin:36.0pt; 	mso-paper-source:0;} div.WordSection1 	{page:WordSection1;} --&gt;\n&lt;p class=\"MsoNormal\"&gt;&lt;span style=\"font-size: 11pt; font-family: \"&gt;Telefone de Suporte 0800-721-0027&lt;/span&gt;&lt;/p&gt;\n&lt;p class=\"MsoNormal\"&gt;&#160;&lt;/p&gt;\n&lt;p class=\"MsoNormal\"&gt;&lt;span style=\"font-size: 11pt; font-family: \"&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;\n&lt;/p&gt;\n&lt;p&gt;Tenha sempre em m&#227;os o n&#250;mero do circuito, a raz&#227;o social da Empresa e o N&#250;mero do CNPJ;&lt;/p&gt;\n&lt;p&gt;&#160;&lt;/p&gt;\n&lt;p&gt;&#160;&lt;/p&gt;',0,16,4,'2010-08-09 10:07:07','2010-08-12 17:05:22'),(34,0,1,36,'CÃ³pia NÃ£o-GenuÃ­na','&lt;p&gt;Segue associado neste item, um tutorial de como Ativar uma chave Aut&#234;ntica do Windows 7.&lt;/p&gt;\n&lt;ul&gt;\n&lt;li&gt;O Windows 7 original cont&#233;m uma tecnologia antipirataria integrada, chamada Tecnologias de Ativa&#231;&#227;o do Windows, possibilitando &#224; Microsoft combater a pirataria de forma mais efetiva. As Tecnologias de Ativa&#231;&#227;o do Windows incluem ativa&#231;&#227;o e valida&#231;&#227;o do produto, que ajudam voc&#234; a garantir que o Windows executado em seu computador seja realmente o original. O Windows 7 original o ajuda a tirar proveito da funcionalidade completa do Windows, ao mesmo tempo em que evita a ocorr&#234;ncia de v&#237;rus, arquivos violados e outros tipos de software maliciosos geralmente associados a software falsificado.&lt;/li&gt;\n&lt;/ul&gt;',0,16,15,'2010-08-09 13:08:42','2010-08-12 17:03:20'),(39,0,1,50,'AtribuiÃ§Ã£o de Item de ConfiguraÃ§Ã£o na Abertura de OcorrÃªncia','&lt;p&gt;Abertura de Ocorr&#234;ncias Tipo:&lt;br /&gt;- Requisi&#231;&#227;o de Servi&#231;o&lt;br /&gt;- Incidente&lt;/p&gt;\n&lt;p&gt;1 - Quando a ocorr&#234;ncia &#233; aberta pelo usu&#225;rio:&lt;br /&gt;- Se for referente ao endpoint (computador) ou perif&#233;rico do usu&#225;rio, atribuir o Item deste a ocorr&#234;ncia.&lt;br /&gt;- Se for outro Item, fechar a ocorr&#234;ncia como n&#227;o resolvida e abrir outra ocorr&#234;ncia pelo Item referido. Esta abertura tem que ser feita com o analista logado na entidade da usu&#225;rio requerente, caso contr&#225;rio esta ser&#225; aberta na Entidade Raiz.&lt;/p&gt;\n&lt;p&gt;2 - Quando a ocorr&#234;ncia &#233; aberta pelo analista:&lt;br /&gt;Sempre estar logado na entidade referente a ocorr&#234;ncia, caso contr&#225;rio esta ser&#225; aberta na Entidade Raiz.&lt;br /&gt;Abrir a ocorr&#234;ncia no Item referente.&lt;br /&gt;Quando o Item n&#227;o puder ser determinado, abrir em Geral.&lt;/p&gt;',0,12,12,'2010-08-12 16:13:57','2010-08-12 16:13:57'),(40,0,0,54,'Chamada em ConferÃªncia','&lt;p&gt;Neste v&#237;deo, seguem as instru&#231;&#245;es para se realizar uma chamada em confer&#234;ncia nos IP\'s Phone Cisco.&lt;/p&gt;\n&lt;h1 id=\"watch-headline-title\"&gt;&lt;a href=\"http://www.youtube.com/watch?v=CN3TcLhslxU\"&gt;&lt;span id=\"eow-title\" title=\"How To Conference Call on the Cisco 7970\" dir=\"ltr\"&gt;Conference Call on the Cisco 7970&lt;/span&gt;&lt;/a&gt;&lt;/h1&gt;',0,16,4,'2010-08-16 10:51:52','2010-08-16 10:51:52'),(41,0,0,55,'Manual Cisco IP Phone','&lt;p&gt;Associado a este item, est&#225; o manual Oficial da Cisco para os IP Phones 7970 Series;&lt;/p&gt;',0,16,4,'2010-08-16 10:55:58','2010-08-16 10:55:58'),(42,0,0,56,'VPN for MAC','&lt;p&gt;Como criar uma conex&#227;o VPN no sistema operacional Mac OS X 10.6&lt;/p&gt;',0,16,5,'2010-09-06 17:05:11','2010-09-06 17:05:11'),(43,0,0,56,'VPN for Windows XP','&lt;p&gt;&lt;a href=\"http://www.windowsecurity.com/articles/Configure-VPN-Connection-Windows-XP.html\"&gt;VPN - Windows XP&lt;/a&gt;&lt;/p&gt;',0,16,0,'2010-09-09 11:03:03','2010-09-09 11:03:03'),(44,0,0,57,'DocumentaÃ§Ã£o oficial Apple','&lt;p&gt;&lt;a href=\"http://support.apple.com/kb/HT2500?viewlocale=pt_BR\"&gt;Documenta&#231;&#227;o oficial Apple&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;&#160;&lt;/p&gt;\n&lt;p&gt;(Como configurar conta de e-mail utilizando o aplicativo Mail do MAC OS X)&lt;/p&gt;',0,16,1,'2010-09-10 09:29:31','2010-09-10 09:29:31'),(45,0,0,58,'Manual Cisco ATA 186','&lt;p&gt;Manual de configura&#231;&#227;o Cisco Analog Telephone Adapter 186.&lt;/p&gt;',0,16,7,'2010-09-17 13:39:41','2010-09-17 13:39:41'),(46,0,0,59,'Active Directory','&lt;p&gt;Instalando e configurando o Active Directory no Windows Server 2008.&lt;/p&gt;',0,16,4,'2010-09-22 08:44:30','2010-09-22 08:44:30'),(47,0,0,60,'Windows Server Updates Services','&lt;p&gt;&lt;a href=\"http://www.guiamcse.com.br/artigos/Instalando_e_Configurando_o_WSUS_2_0_SP1.html\"&gt;Instalando e configurando o Windows Server Updates Services SP1&lt;/a&gt;&lt;/p&gt;',0,16,1,'2010-09-22 09:31:40','2010-09-22 09:31:40'),(48,0,0,62,'Manual 1','&lt;p&gt;Manual 1 de configura&#231;&#227;o e especifica&#231;&#245;es da IP Camera Sony, modelo SNC-P1.&lt;/p&gt;',0,16,6,'2010-09-24 12:44:12','2010-09-24 12:44:12'),(49,0,0,62,'Manual 2','&lt;p&gt;Manual de especifica&#231;&#245;es e configura&#231;&#245;es IP Camera Sony SNC-P1.&lt;/p&gt;',0,16,2,'2010-09-24 12:45:43','2010-09-24 12:45:43'),(50,0,0,63,'ConfiguraÃ§Ã£o Blackberry','&lt;p&gt;Segue associado um tutorial para configura&#231;&#227;o dos aparelhos celulares Blackberry para o recebimento dos e-mails Verto.&lt;/p&gt;',0,16,4,'2010-09-27 12:05:59','2010-09-27 12:05:59'),(51,0,0,64,'Guia do UsuÃ¡rio','&lt;p&gt;Guia do usu&#225;rio para as funcionalidades do Cisco Unity Voice Mail.&lt;/p&gt;'