ail do dia 07.12.10.',0,0),(2738,709,'2010-12-07 10:38:32',129,'Documento adicionado : Documentar Chamado 709',0,0),(2739,709,'2010-12-07 10:38:56',129,'A senha foi trocad com Ãªxito.',0,0),(2740,700,'2010-12-07 10:51:50',129,'Entrei em contato com a empresa, mas o responsÃ¡vel pela manutenÃ§Ã£o da impressora nÃ£o estava no local. Aguardando o retorno da empresa. ',0,0),(2741,711,'2010-12-07 12:06:00',129,'De acordo com o colaborador Ovidio Filho, a senha foi destravada. Contato feito por telefone.',0,0),(2742,700,'2010-12-07 16:01:56',129,'Impressora foi devolvida para a Verto depois da manutenÃ§Ã£o. Instalada e ok. ',0,0),(2743,712,'2010-12-08 09:41:49',129,'Realizado a programaÃ§Ã£o do outlook como solicitado pela colaboradora.',0,0),(2744,716,'2011-02-03 13:40:31',131,'Foi encaminhado o chamado para Ovideo. \r\nProblemas desde o map 65 até o map 39.',0,1),(2745,716,'2011-02-04 14:39:55',131,'entrei em contato com a Rosana da cet-rio e a mesma informou que esta sem viaturas p/ o local. Retornar a ligação as 15 hs pra saber se tem carro disponível.',0,1),(2746,716,'2011-02-04 17:53:25',131,'Não foi possível a equipe da Cet-rio acompanhar o trabalho agendado para hoje 04/02/11, pois não há viaturas disponíves devido as obras da Av Brasil.\r\nA Cet-Rio solicitou que retornasse na segunda feira 07/02, para tentar um novo agendamento. \r\nAproveitando a oportunidade,está agendado p/ sábado (05-02) o conserto dos Ap\'s do 1 ao 6 na Av. Brasil ( altura Rodrigues Alves até Av. Rio de Janeiro)equipe chegará ao local a partir das 9 hs da manhã.',0,1),(2747,716,'2011-02-07 18:24:06',131,'1 - – Trecho barros filho até o vd lusitana – MAP67 até MAP037 .\r\nA CET – RIO não disponibilizou o acompanhamento para execução do reparo, informando que só poderia ser as 23:00hs de Domingo. Sendo assim agendamos para segunda feira. \r\n\r\n2 – Trecho MAP01 Rodrigues Alves até MAP06 Av. Rio de Janeiro.\r\nO Técnico  esteve no local acompanhando a TALITEL e foi notado que no trecho entre o Viaduto de acesso à Ponte RIO – NITEROI e o CAJU, há um poste caído. Com isso, não só a Infra da VERTO foi danificada, como também a própria iluminação do local.  \r\n\r\nO Técnico ainda tentou outra solução de contorno do problema ( atravessando cabos pela Via) porém no local a uma circulação muito grande de Veículos altos e impossibilitando a alternativa.  Na segunda feira entraremos em contado com a FAETEC para nos auxiliar em solicitar o reparo do poste junto aos órgãos responsáveis.\r\n',0,1),(2748,716,'2011-02-09 16:17:46',131,'Confirmado com a Cet-Rio para as 23 hs, o acompanhamnto junto com a talitel para reparo.Ovideo irá acompanhar.',0,1),(2751,716,'2011-02-15 10:21:17',131,'Ontem 14/01 efetuamos a fusão na Av. Brasil (altura do Caju) porém não funcionou.\r\n\r\nHoje 15/01 foi feito um agendamento as 13hs com os agentes da CETRIO para acompanhamento do conserto no Switch, que provavelmente está causando o defeito entre os Ap’s .   ( Ruas Srg Silva Nunes e Rua Teixeira Ribeiro - pista de descida, sentido Centro)\r\n',0,1),(2752,716,'2011-02-17 09:37:18',131,'O trecho da av. Brasil está parado entre o  Map70 ao Map92  podendo ser algum problema de elétrica. Entrei em contato com a Talitel para  averiguação e conserto neste local. Porém, o trecho fica em área de risco , e será necessário acompanhamento de seguranças no local.  (o trecho fica entre as favelas: Catiri, Vila Vintém, Favela do Batan, Morro do Capim, Morro do Carrapato)\r\n \r\nSerá necessário 2 seguranças no local. O valor para cada segurança é de R$ 200. \r\n \r\nFavor verificar com urgência o valor a ser reembolsado para o serviço de segurança neste local.  O Agendamento com a Talitel está programado para amanhã as 11Hs.\r\n',0,1),(2753,716,'2011-02-17 09:37:57',131,'Entrei em contato com o Cabral e o mesmo me informou que neste trecho entre os Ap’s informados abaixo não existe a “faca” do transformador. Essa faca existe somente no  início da Rodrigues Alves (altura da Rodoviária).\r\n\r\nEntrei em contato com a Talitel e eles me informaram que será necessário segurança no local por ser área  de risco com histórico inclusive de assaltos a funcionários Verto e Talitel. Os técnicos já  irão ao local para averiguar e se for possível solucionar o problema (roubo de fibra, ou falha elétrica). \r\n\r\nLembrando que se for necessário fazer fusão de fibra, teremos que solicitar a empresa JGCM (Jocélio) e novamente acionar os seguranças.\r\n\r\nFico no aguardo de um retorno para confirmação e agendamento do serviço com a Talitel.\r\n',0,1),(2754,716,'2011-02-22 16:09:40',131,'P/ o conhecimento\r\n \r\nLigamos para o Jocélio e ele nos informou que não foi possível o conserto da fibra no sábado 19/02 do ponto 1 ao 6. Já passamo p/ o mesmo fazer a vistoria e conserto dos roots 66 e 73.\r\n \r\nEstá agendado para quinta-feira dia 24/02 o reparo dos roots. Estarei ligando na quarta 23/02 para confirmar o serviço e se for o caso agendar com a Cet-rio.\r\n \r\n\r\n',0,1),(2755,716,'2011-02-22 16:11:01',131,'fizemos a manutenção na Av. Brasil no dia 19/02 entre o root 73 ao 80 e foi possivel apenas levantar o root 80 que apresentou falhas na rede elétrica e foi identificado falha de fibra entre root 66 ao root 73 e estaremos fazendo programações para estabilizar todo o trecho entre a R. do Oeste e Estr. Da Equitação.',0,1),(2756,716,'2011-02-23 13:26:38',131,'O Jocélio nos ligou informando que existe cabos cortados debaixo da Linha vermelha, fazendo com que os ap’s  1 ao 6 estejam indisponíveis , além disso, perto do root 6 os cabos de elétrica estão caídos no chão.(os mesmos que eles já haviam consertado).\r\n\r\nAmanhã 24/02 o Ovídeo estará indo ao local na parte da tarde fazer vistoria .\r\n\r\n',0,1),(2757,716,'2011-02-23 17:43:37',130,'Senhores, amanhã 24/02, o Jocélio estará indo verificar os roots 87, 136, 143 acompanhado com o Técnico Rafael.\r\n\r\nNão será necessário averiguar os AP’s : 64 (está com problema de visada), 72,73,74 (estão desligados propositalmente por causa da área de risco).\r\n\r\nAts, \r\n',0,1),(2758,716,'2011-02-25 15:55:49',130,'DATA: 24/02/11 HORÁRIO:11:00 ANALISTA:Carlos Rocha\r\nDESCRIÇÃO : O tecnico Rafael acompanhou a Lazer Fusão nos AP\'s 136 e 147. Foi diagnosticado que os dois AP\'s estavam com falha elétrica.',0,1),(2759,716,'2011-02-25 15:56:42',130,'DATA: 25/02/11 HORÁRIO:15:50 ANALISTA:Carlos Rocha\r\nDESCRIÇÃO : O tecnico Ovideo acompanhou a Talitel no reparo e os dois AP\'s voltaram a funcionar.',0,1),(2760,716,'2011-02-28 15:55:52',130,'DATA 28/02/2011 HORARIO 15:55 ANALISTA Carlos Rocha\r\nDESCRIÇÃO:Concluímos o reparo dos Roots 136 e 143. Aproveitamos a visita aos roots e fizemos o reparo do Mesh 137.  Porém não conseguimos efetuar a vistoria dos meshs 127, 124, 123, 121, 120 e 119, aproveitando esta mesma visita, pois o trafego de veículos no local está intenso.\r\nO profissional da Talitel afirma que é necessário neste ponto do apoio da CET- RIO pois coloca em risco a vida dos funcionários. O Ovideo confirmou que o trafego de veículos realmente é muito alto.\r\nQuanto aos AP’s 1 ao 15 o Jocelito está em contato com fornecedores para aquisição do cabo optico e estamos aguardando',0,1),(2761,716,'2011-03-10 10:36:01',130,'DATA 03/03/2011 HORARIO 17:00 ANALISTA Carlos Rocha\r\nPrezados efetuamos reparo nos AP’s 120 e 121. Foi feita a visita nos seguintes AP’s: Mesh \r\n127, 124, - elétrica OK , porém AP’s parados\r\n123 - restabelecida elétrica, porém tentando associação com root. \r\n121, 120- restabelecida elétrica voltou a funcionar normalmente. Os Ap\'s 111,110,107,105 - não foi verificado, chovendo no local. Root 87 – necessário CET _RIO. AP 101 - não foi verificado, chovendo no local\r\n',0,1);
